const ArgumentType = require('../../extension-support/argument-type');
const BlockType = require('../../extension-support/block-type');
const formatMessage = require('format-message');
// const MathUtil = require('../../util/math-util');

/**
 * Icon svg to be displayed at the left edge of each extension block, encoded as a data URI.
 * @type {string}
 */
// eslint-disable-next-line max-len
const blockIconURI = 'data:image/svg+xml;base64,';
const menuIconURI = blockIconURI; 

class Scratch3HelloBlocks {
    constructor (runtime) {
        /**
         * The runtime instantiating this block package.
         * @type {Runtime}
         */
        this.runtime = runtime;
    }


    /**
     * The key to load & store a target's pen-related state.
     * @type {string}
     */
    static get STATE_KEY () {
        return 'Scratch.helloWorld';
    }

    /**
     * @returns {object} metadata for this extension and its blocks.
     */
    getInfo () {
        return {
            id: 'helloWorld',
            name: formatMessage({
                id: 'helloWorld.categoryName',
                default: 'hello World',
                description: 'Label for the hello world extension category'
            }),
            // menuIconURI: menuIconURI,
            blockIconURI: blockIconURI,
            // showStatusButton: true,
            blocks: [
                {
                    opcode: 'say',
                    blockType: BlockType.COMMAND,
                    text: formatMessage({
                        id: 'helloWorld.say',
                        default: 'say [TEXT]',
                        description: 'say something'
                    }),
                    arguments: {
                        TEXT: {
                            type: ArgumentType.STRING,
                            defaultValue: formatMessage({
                                id: 'helloWorld.defaultTextToSay',
                                default: 'hello world',
                                description: 'default text to say.'
                            })
                        }
                    }
                },

                {
                    opcode: 'openNewCanvas',
                    blockType: BlockType.COMMAND,
                    text: formatMessage({
                        id: 'helloWorld.open',
                        default: 'open',
                        description: 'open New Canvas'
                    }),
                    arguments: {
                    }
                }

            ],
            menus: {}
        };
    }

    say (args, util) {
        const message = args.TEXT;
        console.log(message);
        // Get base64 image from stage canvas.
        this.runtime.renderer.draw();
        const stage_img = this.runtime.renderer._gl.canvas.toDataURL('image/png');
        console.log(stage_img);

        // this.runtime.renderer.draw();
        // var ctx = this.runtime.renderer._gl.canvas.getContext("webgl");
        // same as this.runtime.renderer._gl ......

        // ctx.drawImage(img, 0, 0);

        this.runtime.emit('SAY', util.target, 'say', message);
    }


    addStyle(styleString) {
        const style = document.createElement('style');
        style.textContent = styleString;
        document.head.append(style);
    }

    dragElement(elmnt) {
        var pos1 = 0, pos2 = 0, pos3 = 0, pos4 = 0;
        if (document.getElementById(elmnt.id + "header")) {
          // if present, the header is where you move the DIV from:
          document.getElementById(elmnt.id + "header").onmousedown = dragMouseDown;
        } else {
          // otherwise, move the DIV from anywhere inside the DIV:
          elmnt.onmousedown = dragMouseDown;
        }
      
        function dragMouseDown(e) {
          e = e || window.event;
          e.preventDefault();
          // get the mouse cursor position at startup:
          pos3 = e.clientX;
          pos4 = e.clientY;
          document.onmouseup = closeDragElement;
          // call a function whenever the cursor moves:
          document.onmousemove = elementDrag;
        }
      
        function elementDrag(e) {
          e = e || window.event;
          e.preventDefault();
          // calculate the new cursor position:
          pos1 = pos3 - e.clientX;
          pos2 = pos4 - e.clientY;
          pos3 = e.clientX;
          pos4 = e.clientY;
          // set the element's new position:
          elmnt.style.top = (elmnt.offsetTop - pos2) + "px";
          elmnt.style.left = (elmnt.offsetLeft - pos1) + "px";
        }
      
        function closeDragElement() {
          // stop moving when mouse button is released:
          document.onmouseup = null;
          document.onmousemove = null;
        }
    }


    openNewCanvas(args, util){
        var img  = new Image();
        //#region img src (base64)
        img.src = "data:image/png;base64,";

        //#endregion

        var canv = document.getElementById('canvasFPV');
        if (canv == null){
            //Inject Draggable Div
            //https://www.w3schools.com/howto/howto_js_draggable.asp
            let str = '<div id="fpvdiv"><div id="fpvdivheader"></div><div id="fpvBox"></div></div>'
            document.body.insertAdjacentHTML( 'beforeend', str );
            //Inject Draggable CSS
            this.addStyle(`
            #fpvdiv {
                position: absolute;
                top:50%;
                z-index: 9;
                background-color: #f1f1f1;
                border: 1px solid #d3d3d3;
                text-align: center;
              }
              
              #fpvdivheader {
                padding: 10px;
                cursor: move;
                z-index: 10;
                background-color: #2196F3;
                color: #fff;
              }
    
              #fpvBox{
                  width:600px;
                  height:400px;
              }
            `);
            this.dragElement(document.getElementById("fpvdiv"));

            
            canv = document.createElement('canvas');
            canv.id = 'canvasFPV';
            canv.height = 400;
            canv.width = 600;
            //document.body.appendChild(canv);
            document.getElementById('fpvBox').appendChild(canv); 
        }
        
        
        var ctx = canv.getContext("2d");

        img.onload = function() {
            ctx.drawImage(img, 0, 0);
        };
        
    }
}

module.exports = Scratch3HelloBlocks;